import React from 'react';
import web from "../src/images/3D-Transparent-PNG.png"
import Common from './Common';

const Home = () => {
    return(
    <>
    <div className="homediv">
    <div id="header" >
            <div className=" container-fluid ">
                <div className="row ">
                    <div className=" bg-secondary col-10 mx-auto">
                        <div className="row ">

{
       <Common name="THE SHADOW OF INNOVATION" 
       sideimg={web} 
       visit="/Service" 
       btname="Get started" 
        brand="Dance Nd Art"
        abt="Online Platform for Dancer and Artist to learn, develope, enhance & showcase their Talent/Skill."
       />
}
    </div>
                    </div>
                </div>
            </div>
        </div>
    
    
      </div>
    </>
    )
}

export default Home;
